column13:
A method for producing an adduct of an organometallic compound M'(R') x , where M' is a Group II or Group III metallic element and (R') x  represents a plurality of organic radicals, which may be the same or different, x being an Integer equal to the valency of M', comprises electrolysing, using a sacrificial anode of the metal M 1 , a solution containing components A, B and C as follows:
 A: a magnesium compound MgR 1 2 ; B: a readily ionisable support electrolyte providing relatively large anions and cations; C: a polar aprotic liquid which is a solvent for both components A and B; 
the metal M' being selected from the group consisting of: indium, gallium, cadmium.
